import { redirect } from "react-router-dom";

const requireAuth = async () => {
  const isLoggedIn = false;
  if (!isLoggedIn) {
    throw new Response("", {
      status: 302,
      headers: {
        Location: "/login",
      },
    })
  }
};
export { requireAuth };
